ENVIROPLAN is an independent private consulting firm with international orientation, founded in 1990, in Athens, Greece. The company is recognised as one of the leading firms in Environmental Management and Engineering Projects.

ENVIROPLAN core field of expertise in Environmental Management & Engineering, lies in the Environment, Infrastructure and Research & Development sectors:
- Environment : Waste Management & Circular Economy, Water, Wastewater & Flood Prevention, Climate Change, Biodiversity & Natural Resources;
-Infrastructure: Energy, Transport & Mobility, Agricultural & Rural Development, Urban & Regional Development;
-R&D and Green Innovation: Circular Economy, Low Carbon & Environmentally Sustainable Technologies and Infrastructures, Smart Development;

Our mission is to provide specialised high level, professional services in the international market. We aspire to be a progressive consultancy firm in both local and international level, offering innovative, state of the art, environmental management services and solutions. Our vision is to actively contribute to the creation of a sustainable future by maintaining a safe, healthy, and cleaner environment , in balance with economic development and social prosperity.The firm is internationally recognized for its high level of expertise and has successfully elaborated up to date multiple projects covering many disciplines and providing a wide range of services. 

ENVIROPLAN holds extensive experience in organising, managing and running Large Projects funded by various IFIs, included but not limited to the EU, EIB, EBRD, WB, KfW , ADB and UNDP, as well as PPP of various types.Over the last 25 years we have obtained significant international experience and a well- deserved reputation by working in various developing and EU accession and transition countries, playing a key role in the development of large-major environmental projects according to the EU regulations and international standards.

EuroObscura is an independent international sales agency focused on delivering high quality European horror - science fiction - action - fantasy movies to the worldwide market.

Our current line-up includes: 

* THE SALAMANDER HOUSE, a creepy witchcraft horror;

* SCREAMS FROM THE SWAMP, a terrifying rape-and-revenge horror movie from Italy;

* QUARANTINE-19, the new pandemic thriller from Turkey;

* REVERIES OF A SOLITARY STROLLER, a mix of animation and live action released by Netflix in Italy;

* WITCHSTARS, a striking funny comedy-horror set during an alien invasion on Halloween day;

* BORN DEAD, a raw and morbid horror movie by Italian director Alex Visani;

* BLUE SUNSET, the first Italian cyber-punk film of the new millennium;

* THE OLD MAN MOVIE, Winner of the Silver Audience Award @ Fantasia 2020 and Best Animated Feature @ Anima 2020;

* NIGHTMARE SYMPHONY, Official Selection at Ischia Film Festival, a compelling horror movie rooted in the Italian Giallo tradition;

* EXILE, Best Feature Nominee at Fantasporto 2020, the Greek crisis through the eyes of a modern Ulysses, foreigner in his own country.

